import React from 'react';
import './CandidateItem.css'
import {Link} from "react-router-dom";
import CandidatePostItem from './CandidatePostItem'
const CandidatesItems = (props) => {
  if (props.candidates.length === 0) {

    return (
      <div className='application-center'>

      </div>
    );
  }
  return (
    <div className='post-active'>
      <h1>Available Post to apply</h1>
      <ul className='posts-list'>
        {props.candidates.map((candidate) => (
          <CandidatePostItem
            key={candidate.id}
            id={candidate.id}
            image={candidate.image}
            name={candidate.name}

          />
        ))}
      </ul>
    </div>
  );
};

export default CandidatesItems;
